import styles from '../dashboard.module.scss';
import Navbar from '../../common/navbar/Navbar';
import { Stepper } from 'react-form-stepper';
import DropdownBar from '../../common/dropdownBar/DropdownBar';
import Dronedisplay from '../../common/droneDisplay/Dronedisplay';

import axios from 'axios';
import { url } from '../../utils/constants';

import { useParams } from 'react-router-dom';
import { useEffect, useState } from 'react';

function BookDroneServiceTwo()   {

    const { id } = useParams()

    const [drones, setDrones] = useState();

    useEffect(() => {
        axios.get(`${url}/api/drone/`, {
            "Content-Type": "application/json",
        })
            .then(function (response) {
                console.log(response.data.data);
                const availableDrones = response.data.data.filter(function(drone) {
                    return drone.status === "available"
                })
            })
            .catch(function (error) {
                console.log(error);
                alert("error")
            });
    }, [])

    return (
        <>
            <Navbar />
            <div className={styles['container']}>
                <div className={styles['sidebar']}>
                    <div className={styles['title']}>
                        Dashboard
                    </div>
                    <div className={styles['options']}>
                        <div className={styles['option']}>
                            Maintenance
                        </div>
                        <div className={styles['option-select']}>
                            Book Drone Service
                        </div>
                        <div className={styles['option']}>
                            My Bookings
                        </div>
                        <div className={styles['option']}>
                            Service Reports
                        </div>
                        <div className={styles['option']}>
                            Profile
                        </div>
                    </div>
                </div>
                <div className={styles['body']}>
                    <div className={styles['info-container']}>
                        <Stepper 
                            steps={[{}, {}, {}]}
                            activeStep={1}
                        />
                        <div className={styles['header']}>
                            Step 2: Drone Catalog
                        </div>
                        <div className={styles['sub-header']}>
                            Select a service and choose your drone
                        </div>
                    </div>

                    <DropdownBar />

                    <br/><br/>

                    1 Drone Found

                    <Dronedisplay />

                    <br/><br/>

                    <div className={styles['navigate-btn']}>
                        <button className={styles['grey']}>Back</button>
                        <button className={styles['blue']}>Save</button>
                    </div>

                </div>
            </div>
        </>
    )
}

export default BookDroneServiceTwo;
